import React from "react";
import { ApolloProvider } from "@apollo/client";
import { client } from "./apollo";
import { Routes } from "./routes";

export default function App() {
  return (
    <ApolloProvider client={client}>
      <Routes />
    </ApolloProvider>
  );
}
